import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
        <div className='app__header'>
            <img className='app__header-image' src=" https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F2%2F2a%2FInstagram_logo.svg%2F1024px-Instagram_logo.svg.png&imgrefurl=https%3A%2F%2Fru.m.wikipedia.org%2Fwiki%2F%25D0%25A4%25D0%25B0%25D0%25B9%25D0%25BB%3AInstagram_logo.svg&tbnid=vdAv6uHM8bqDTM&vet=12ahUKEwiRlN21wIvrAhUNs6QKHUqgDeIQMygSegUIARDFAQ..i&docid=BtL1wgRtru5YkM&w=1024&h=366&q=instagram%20logo&safe=active&ved=2ahUKEwiRlN21wIvrAhUNs6QKHUqgDeIQMygSegUIARDFAQ" alt=""/>
        </div>
    </div>
  );
}

export default App;
